export const homePageClear = () => {
    return {
        type : 'CLEAR_HOMEPAGE'
    }
};

export const homePageLibraryId = (value) => {
    return {
        type : 'UPDATE_HOMEPAGE_LIBRARY_ID',
        payload : value
    }
};
